import { objectsSliceActions } from "../../Objects";

export const getFransheses = ({userId}) => (dispatch) => {
    const options = {
        method: "POST",
        headers: {
          "Content-Type": "application/json;charset=utf-8",
        },
        body: JSON.stringify({
          userId,
        }),
      };

    fetch("http://localhost:4000/getFranshises", options)
    .then(res => res.json()) 
    .then(data => {
        dispatch(objectsSliceActions.addFranshises(data))
    })
    .catch(err => console.log(err))
}
